In the for loop, we wrote numbers.push(u64::from_str(&arg).expect("failed to parse argument")); A number of things are happening here, and let's examine the statement from inside-out: We are firstly taking an immutable reference to an argument arg with the ampersand operator &, &arg. We pass this reference to the from_str method implemented on the u64 type. The u64::from_str method tries to parse the string into an u64, and returns a Result<T, E> type which is an enumeration (enum) of two possibilities: A successful computation , denoted by Ok(T); or A failed computation , denoted by Err(E). Reference: std::Result enum Result<T, E> { Ok(T), Err(E),
} In the context of u64::from_str, Ok(u64) indicates a successful parse, and Err(e) indicates a failed parse with e being the value explaining why the parse failed. Note: this is analogous to Haskell's Either typeclass which also encodes such binary possibilities of success or failure at the type level, enforcing error-handling at compile time. Enforcing error-handling at the type-level means if errors are not handled, they fail early at compile time. Functions which perform I/O and/or interact with the operating system (OS) all return std::Result types with Ok carrying the successful value or some type T, and the Err variant with an error code from the ssytem. To conform with the zero-cost abstraction principle, Rust does not have exceptions (at least in the Rust 2018 edition). Error handling is typically performed via Result types or via panics. We ensure that the parse is successful using the expect method defined on the Result type. Should the parse fail, expect panics with the error message extracted from the Err(e). A successful parse simply evaluates to a u64 value. We push the u64 value to the numbers vector. If we don't receive any numbers as arguments, i.e. if the check numbers.len() == 0 fails, we print an error message to the standard error output stream via std::io:stderr() and invoking the writeln! macro. The unwrap method checks that we successfully printed the error message to stderr. We then abort the process with an non-zero exit code 1 which by convention indicate abnormal exit. Then, we use d to track the GCD for the numbers we already processed. Note the for loop for m in &numbers[1..] { d = gcd(d, *m);
} Here we are trying to iterate over a Vec which could be of arbitary size which could potentially be very large. Rust delegates the responsibility of memory management to the programmer, but helpds to check memory correctness. When we iterate, we don't need to take ownership of the vector but instead we only borrow its elements so we can read their values. The & operator for &numbers[1..] borrows a reference to the vectors elements for the second element to the last element, which is known a slice (numbers[1..]), a readonly view into the vector collection. The m borrows each element in numbers sequentially, and so m is a reference of type &u64. We derefence m via the dereferencing operator *m so we can read its value. Because the ownership of the vector and its elements belong to the local variable numbers, Rust knows it can safely free the vector and its contents when the name numbers go out of scope and the end of main. Note that Rust assumes successful execution if main finishes executing, and we need to explicitly invoke methods such as expect or std::process:exit to terminate the process with non-zero error status codes, unlike C/C++.

